    "metaTagDescription": "Um cronógrafo com movimento Calibre Quartz inspirado nas corridas automobilísticas, com mostrador com padrão asfalto e Super-Luminova aplicado nos índices e ponteiros, perfeito para os desafios da alta velocidade. Versátil, robusto e construído para dominar, este relógio de corrida é resistente à água até 200 metros, graças à coroa rosqueada em PVD preto.\n\nCRONOMETRAGEM DE VOLTA DINÂMICA\nUm TAG Heuer de sincronização precisa graças ao bezel fixo em cerâmica com escala taquimétrica, com três contadores de cronógrafo monitorando cada fração de segundos, garantindo a pole position.\n\nULTRAPASSAGEM OUSADA\nA robusta caixa de 43 mm com detalhes escovados e polidos o torna no relógio mais moderno para o dia a dia, com visual vigoroso para quem busca avançar com estilo.\n\nCORRIDA AUTOMOBILÍSTICA COM ESTILO\nCombinando com o mostrador e o bezel, a pulseira em tecido de alta qualidade com atraentes detalhes de pesponto amarelo-limão é presa por uma fivela, garantindo maior conforto na pista de corrida.",
